import anyacat from './images/anyacatfon1.png'
import anyacatobr from './images/anyacatobr.png'
import './support-classes.css'


export default function WhoUs() {
    
    function NoteCreate(event) {
        const note = document.getElementById('appleBanner')
        note.style.opacity = 1
        
    }
    
     function NoteDelete(event){
        const note = document.getElementById('appleBanner')
        note.style.opacity = 0
        console.log('on')
    }

    return(
        <>
        <div className='h-250 '>
        <div className="opacity-0 " id='appleBanner'>Аня я тебя люблю</div>
        <img className=' h-96' src={anyacat} alt='anyata'></img>
        <img className=' hover:rotate-180 duration-75 h-96 ' onMouseOver={NoteCreate} onMouseOut={NoteDelete} src={anyacatobr} alt='anya'></img>
        </div>
        </>
    )}
